import React from 'react';

const myUserData = ({ userData }) => {
    const userDataValues = Object.values(userData);
    return (
        <div className='myUserData-container'>
            {userDataValues.map(value => <p>{value}</p>)}
        </div>
    );
};

export default myUserData;
